import React, {Component} from "react";

class Timer extends Component {
    constructor(props) {
        super(props);
        this.state = {
            hours:'0',
            minutes:'0',
            seconds:'0'
        }
    }
    
    render () {
        return (
            <p></p>
        );
    }
}

export default Timer;
